import React from 'react';
import Navbar from './Navbar'

function App() {
  return (
    <div className="App">
      <Navbar/>
      <div className='container'>
        <h1>Faça a pesquisa dos 10 principais repositórios das seguintes linguagens: </h1>
        <ul>
          <li>Dart</li>
          <li>Kotlin</li>
          <li>JavaScript</li>
          <li>Ruby</li>
          <li>Swift</li>
        </ul>
      </div>
    </div>
  );
}

export default App;
